# Input: Two strings, Pattern and Genome.
# Output: A collection of space-separated integers specifying all starting positions where Pattern appears as a substring of Genome.

pattern = "CCCACGCCC"
genome = ""

def isIndexStartOfPattern(startIndex):
  letters = ""
  for i in range(startIndex, startIndex + len(pattern)):
    if (i < len(genome)):
      letters += genome[i]

  return letters == pattern


def getIndicesWherePatternStarts():
  indices = ""
  for i in range(0, len(genome)):
    # print(isIndexStartOfPattern(i))
    if (isIndexStartOfPattern(i)):
      indices += str(i) + ' '
  return indices

print(getIndicesWherePatternStarts())
